import React from "react";
import styled from "styled-components";
import SVG from "../static/svg/svg";
import { SvgContainer } from "./Useless";
const Container = styled.div`
    width: 100%;
    height: 50px;
    background-color: black;
    svg {
        width: 25px;
        height: 25px;
    }
`;
const ActionMenu = () => {
    return (
        <Container>
            <SVG type="arrow" />
        </Container>
    );
};

export default ActionMenu;
